description:
Category	Feature, Couples

Director	Scott Allen
Starring	Asphyxia Noir, James Deen, Chanel Preston, Bridgette B, Skin Diamond, Nick Manning, Ryan Driller

White Witch leads you through the sensuous, seedy underbelly of the City of Angels. Rourke, a private detective with a broken past is enlisted to locate a man. The wild goose chase bagins with his sexy journalist bed-buddy who exchanges sex for a few leads. A significant lead is a promiscuous white witch who gives him a mysterious tea concoction that sends him into a series of flashbacks.The suspense is palpable, as bodies begin to pile up and the realization that a name and career change are not enough to shake the devil from his scent!

